textDisplay:
@Елена Таргонская Про ледоколы первые кстати нам вечно врут. Мы не были первыми, и не мы первыми построили в мире ледоколы.  Зато у нас правители всегда ловко меняли таблички с названиями на иностранных ледоколах начиная с царских времен.  Даже самый первый наш ледокол кстати не построен в России , а построен на совесть и в Великобритании, да на их британской верфи в 1896 г. Построен по заказу царского правительства ледокол " Ангара", который сейчас является самым старым из ныне сохранившихся и стоит в Иркутске на реке Ангара и является сейчас музеем. Так что это даже не наше производство- ледоколы.. я была в этом  музее - ледоколе например в Иркутске... грустное и печальное зрелище как и сам нищий , облезлый  Иркутск. Мне знаете очень печально такое видеть и осознавать и чем там гордиться не вижу смысла и не понимаю.  Мы отстаем. 

Везде у нас также пишут , что первый в мире русский ледокол " Ермак" сделал то то и то то. Проверяю что это за ледокол наш " Ермак" , и оказывается,  что Наш " Ермак" и не Ермак и не наш, а сделан он в 1897  г. , то есть даже на 11 лет позже ледокола " Ангара " построенного в Великобритании..  Нормально?  И так везде вранье на вранье, враньем погоняет.. все надо проверять и перепроверять. Смотрим : It was built in Newcastle upon Tyne at its Low Walkeryard and launched in 1898. She was named after the famous Russian explorer of Siberia, Don Cossackataman Yermak Timofeyevich. Нормально?  Тоесть построен наш " Ермак" в Великобритании,  в  городе Newcastle , что в 166 км от Эдинбурга. Тоесть в 19 веке мы не строили вообще ледоколы? Нам их строила Великобритания. Нормально, что уж.;) Мы не умели строить ледоколыили что? Смотрим еще про ледоколы типа наши. Ледокол наш " Пайлот", сразу настораживает английское название " Пайлот", тоесть Pilot английское. Проверяем: 
По данным о судах, приписанных к Кронштадту, в середине 80-х гг. XIX в. «Пайлот» («Pilot») числился построенным в Англии в 1865 г.  Да, что ж такое то, опять англичане построили корабль, а не мы. По сведениям, помещенном в «Списке речных паровых судов России» (за 1897 и 1902 г.), наименование парохода было именно «Pilot», а тип – буксирно-пассажирский-ледорезный. Не мы его строили короче, но переименовали на русский лад, и повесили русский флаг. Нормально, что уж. Голь на выдумки горазд, это я про нас..) ищем дальше.  В 1837 году в Филадельфии (США) был построен деревянный колесный пароход «City Ice Boat No. 1», предназначенный для колки льда в гавани. Тоесть в 1837 уже строили ледоколы в сша.., даже 1865 - 1837= 28 лет. Тоесть на 28 лет раньше в Сша уже строили ледоколы. Получается Сша были раньше Великобритании в этом деле. А мы вообще ничего не строили в то время, у нас   вообще было тогда еще крепостное право.

@Александр Северянин А что старики уже не в почете?Ну да,что понимают люди которые прожили больше чем ты.Я спрашивал своих и они объективно говорят,что Путину пока замены нет.Все остальные как например Зюганов и Жириновский пережитки прошлого,не способные делать а только говорить.Тоже самое и яблочники.И прочия либерда.У них кроме лозунгов нет никакой внятной идеи и стратегии.Тоже самое и Навальный с его 5ю шагами.Идею Которую засмеяли.Все кого я знаю называют его мутным типом.Тоже самое и про всю оппозицию,продажную шоблу.
Так что Путину пока альтернативы НЕТ!
Это не моя хотелка,это реальность.

@Александр Северянин Ну если ты не понимаешь это твои проблемы!Сравни Россию 90х и ранних нулевых и сейчас.Вопросы отпадут.Думающие люди не будут агульно обвинять человека без доказательств.У тебя есть доказательства что в инете сидят проплаченные кремлеботы?)Это даже смешно обсуждать.

Все вы говорите что справитесь,а на практике...да если тебя посадить ты просрешь всю страну с такими мыслями.Вон один на Украине также думал.Стал президентом.И что?Стало там лучше?Даже если выкинуть всю пропаганду,объективно,то туда мало кто стремится.Скорее оттуда выезжают больше.
Твоя риторика излишне эмоциональна и не имеет связь с реальностью.

