@Ant๏ninα Ну ты и "навалила" информации.Ну когда я был молодым я может и верил оппозиции.Но потом поумнел.Понял что они тоже мошенники.Понял что у них тоже есть недвижимость за бугром.Что дети у них учатся за границей и т.д.Я смотрю вас не смущает что некоторые из ваших за границей вещают.И деньги берут иностранные.Как например Ходорковский или Навальный.Забавный факт про Навального!Любобытно что он когда работал в Киров лес,не был особо обеспеченным.А после развала и разваровывания бюджета у него откуда то взялись деньги и на обучение в Америке, и на джипы, и на охрану, и на Черногорие.Так что здесь не я слепой,а ты.
Надеюсь ты поумнеешь и поймешь что те кто любят свою страну,ее не топят.И не просят у других стран денег на переворот(Навальный).Нормальные люди говорят и хорошее и плохое.Стараются ее поддержать.А не втаптывают в говно.

P.S. В развале страны вините лучше тех кто в 90х перестройку решил устроить и развалил СССР.Таких как Горбачев,Ельцин,Гозман,Козырев и т.д.Поэтому большинство людей никогда не поддержат оппозицию.На те же грабли не встанут.И поэтому в таких как Навальный и будут швырять зеленку.
